import React, { useState } from 'react';

const CropPrediction = () => {
    const [formData, setFormData] = useState({
        N: '',
        P: '',
        K: '',
        temperature: '',
        humidity: '',
        ph: '',
        rainfall: '',
    });

    const [responseData, setResponseData] = useState(null);
    const [error, setError] = useState(null);

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setResponseData(null);
        setError(null);

        try {
            const response = await fetch('http://localhost:5000/api/auth/predict', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    N: parseFloat(formData.N),
                    P: parseFloat(formData.P),
                    K: parseFloat(formData.K),
                    temperature: parseFloat(formData.temperature),
                    humidity: parseFloat(formData.humidity),
                    ph: parseFloat(formData.ph),
                    rainfall: parseFloat(formData.rainfall),
                }),
            });

            const data = await response.json();

            if (response.ok) {
                setResponseData(data);
            } else {
                setError(data.message || 'Error predicting crop');
            }
        } catch (err) {
            setError('Failed to connect to the backend');
        }
    };

    const handleLogout = () => {
        // Add your logout logic here (e.g., clearing auth token, redirecting)
        alert("Logged out!");
    };

    return (
        <div style={styles.container}>
            <div style={styles.chatContainer}>
                <button style={styles.logoutButton} onClick={handleLogout}>Logout</button>
                <h1 style={styles.header}>üåæ Crop Prediction</h1>

                <div style={styles.chatBox}>
                    {responseData && (
                        <div style={styles.responseBubble}>
                            <strong>üå± Suggested Crop:</strong>
                            <pre style={styles.jsonResponse}>{JSON.stringify(responseData, null, 2)}</pre>
                        </div>
                    )}
                    {error && (
                        <div style={styles.errorBubble}>
                            ‚ö†Ô∏è {error}
                        </div>
                    )}
                </div>

                <form style={styles.form} onSubmit={handleSubmit}>
                    {Object.keys(formData).map((key) => (
                        <div key={key} style={styles.inputContainer}>
                            <input
                                type="number"
                                id={key}
                                name={key}
                                value={formData[key]}
                                onChange={handleChange}
                                placeholder={key.charAt(0).toUpperCase() + key.slice(1)}
                                style={styles.input}
                                required
                            />
                        </div>
                    ))}
                    <button type="submit" style={styles.submitButton}>Predict Crop</button>
                </form>
            </div>
        </div>
    );
};

const styles = {
    container: {
        height: '100vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        background: '#343541', // ChatGPT dark theme
        fontFamily: "'Poppins', sans-serif",
    },
    chatContainer: {
        width: '400px',
        background: '#40414F', // ChatGPT chat window background
        padding: '20px',
        borderRadius: '12px',
        boxShadow: '0px 4px 10px rgba(0, 0, 0, 0.2)',
        color: '#ffffff',
        display: 'flex',
        flexDirection: 'column',
        position: 'relative',
    },
    logoutButton: {
        position: 'absolute',
        top: '10px',
        right: '10px',
        background: '#FF5555',
        color: '#fff',
        border: 'none',
        padding: '8px 12px',
        borderRadius: '6px',
        fontSize: '14px',
        cursor: 'pointer',
        transition: 'background 0.3s',
    },
    header: {
        fontSize: '20px',
        fontWeight: 'bold',
        textAlign: 'center',
        marginBottom: '10px',
        color: '#00A67E',
    },
    chatBox: {
        minHeight: '120px',
        maxHeight: '200px',
        overflowY: 'auto',
        padding: '10px',
        background: '#444654',
        borderRadius: '8px',
        marginBottom: '15px',
        display: 'flex',
        flexDirection: 'column',
        gap: '10px',
    },
    responseBubble: {
        background: '#4CAF50',
        color: 'white',
        padding: '10px',
        borderRadius: '10px',
        textAlign: 'left',
        wordWrap: 'break-word',
    },
    errorBubble: {
        background: '#FF5555',
        color: 'white',
        padding: '10px',
        borderRadius: '10px',
        textAlign: 'left',
        wordWrap: 'break-word',
    },
    form: {
        display: 'flex',
        flexDirection: 'column',
