        padding: '5px',
    },
    input: {
        width: '100%',
        padding: '10px',
        border: 'none',
        borderRadius: '6px',
        fontSize: '14px',
        color: '#fff',
        background: 'transparent',
        outline: 'none',
    },
    submitButton: {
        width: '100%',
        padding: '12px',
        fontSize: '16px',
