        color: '#fff',
        backgroundColor: '#00A67E',
        border: 'none',
        borderRadius: '8px',
        cursor: 'pointer',
        transition: 'background 0.3s',
    },
    jsonResponse: {
        fontSize: '14px',
        backgroundColor: '#fff',
        padding: '10px',
        borderRadius: '5px',
        color: '#000',
        wordWrap: 'break-word',
    },
};

export default CropPrediction;
